  return (
    <View style={styles.container}>
      <Text style={styles.header}>Details</Text>
      <Image
      resizeMode='contain'
      style={styles.img}
      source={images.referenceImg}/>
      <Button  mode="contained" onPress={() => console.log('Pressed')}>
    Back
  </Button>
    </View>
  );
}
const styles = StyleSheet.create({
  header:{
